var showModalDialog = async function(uri, dialogArguments, options) {
    if (!nw) return false;
    console.log("Showing popup");
    var parseOptions = (options)=> {
        options = options || {};
        if (typeof options == "string") {
            var result = {};        
            var opt = options.split(";");
            for (var i in opt) {
                if (!opt[i]) continue;
                var optPair = opt[i].split(":");
                if (optPair.length == 0) continue;
    
                var value = optPair[1].trim();
                if (value == "off" || value=="no" || value=="0") value = false;
                if (value == "on" || value=="yes" || value=="1") value = true;
                result[optPair[0].trim()] = value;
            }
        } else {
            result = options;
        }

        if (result.center) result.position = "center";
        if (result.dialogheight) result.height = result.dialogheight;
        if (result.dialogwidth) result.width = result.dialogwidth;
        return result;
    }
    
    var filterOptions = (options) => {
        var validKey = [
            "id",
            "title",
            "width",
            "height",
            "toolbar",
            "icon",
            "position",
            "min_width",
            "min_height",
            "max_width",
            "max_height",
            "as_desktop",
            "resizable",
            "always_on_top",
            "visible_on_all_workspaces",
            "fullscreen",
            "show_in_taskbar",
            "frame",
            "show",
            "kiosk",
            "transparent",
            "new_instance",
            "mixed_context",
            "inject_js_start",
            "inject_js_end",
            "id"
        ]
        var result = {};
        for (var i in options) {
            if (validKey.includes(i) == false) continue;
            result[i] = options[i];
        }
        return result;
    }


    options = parseOptions(options);



    var win = nw.Window.get();
    var overlay = document.createElement("div");
    overlay.style.position = "fixed";
    overlay.style.width = "100vw";
    overlay.style.height = "100vh";
    overlay.style.top = "0px";
    overlay.style.left = "0px";
    overlay.style.left = "0px";
    overlay.style.zIndex = "9999999";
    overlay.style.background = "rgba(0,0,0,0.3);";
    document.body.appendChild(overlay);
    var popupWindow;

    // "ding" sfx when focus on background window
    var audio = new Audio('data:audio/wav;base64,');

    var clearModal = () => {
        popupWindow = undefined;
        overlay.removeEventListener("click", focusOnPopup);
        win.removeListener("focus");
        overlay.remove();
    }

    var focusOnPopup = function(e) {
        if (!popupWindow) return;
        try{
            if (Boolean(popupWindow.window) == false) return;
            popupWindow.focus();
            audio.play();
        } catch (e) {
            
        }
    }

    win.on("focus", function(e) {
        focusOnPopup(e);
    });
    
    overlay.addEventListener("click", focusOnPopup);

    var popupOptions = filterOptions(options);
    console.log("Opening window with options:", popupOptions);

    return new Promise((resolve, reject) => {
        nw.Window.open(uri, popupOptions, function(new_win) {
            // do something with the newly created window
            new_win.window.dialogArguments = dialogArguments;
            popupWindow = new_win;
            new_win.focus();
    
            if (options.dialogleft) new_win.x = parseInt(options.dialogleft);
            if (options.dialogtop) new_win.y = parseInt(options.dialogtop);
            
            // when the window is reloaded via refresh button, reapply the parameters
            new_win.on("loaded", ()=> {
                new_win.window.dialogArguments = dialogArguments;
            });

            // Release the 'win' object here after the new window is closed.
            new_win.on('closed', function () {
                new_win = undefined;
                clearModal();
                resolve();
            });        
        });  
    })
     
}

window.showModalDialog = showModalDialog;
exports.showModalDialog = showModalDialog;